INSERT INTO accounting_categories (id, code, display_name, description) VALUES
  (1, 'CORE_REV', 'Core Revenue', 'Primary income generated by the business, e.g. rental income for apartment complexes.'),
  (2, 'OTHER_INC', 'Other Income', 'Ancillary income such as parking fees, vending, or laundry revenue.'),
  (3, 'COGS', 'Cost of Goods Sold', 'Direct costs related to the production of service or goods, or direct costs allocated to service delivery.'),
  (4, 'OPEX', 'Operating Expenses', 'Recurring daily expenses necessary to run the business such as salaries, utilities, and maintenance.'),
  (5, 'DEPR', 'Depreciation/Amortization', 'Non-cash expense representing the gradual consumption of fixed or intangible assets.'),
  (6, 'TAX', 'Taxes', 'Government or property-related tax expenses.'),
  (7, 'FIN', 'Financing Costs', 'Expenses related to financing such as interest and bank fees.'),
  (8, 'OTHER_EXP', 'Other Expenses / Miscellaneous', 'Any other operational expenses that do not fit in the above categories.');
